script: |
  super -f tsv -I q1464.sql | sort > q1464.out

vector: true

inputs:
  - name: q1464.sql
    data: |
      SELECT DISTINCT + COUNT ( col0 ) AS col1 FROM tab1 AS cor0 WHERE + 62 - - 95 NOT BETWEEN col0 + + col1 / - 92 - + col0 + + col0 * - ( + col1 ) * col1 AND + 91 + + + col1;
  - name: tab1

outputs:
  - name: q1464.out
    data: |
      3
